simplesect.para:
Example code for the generation of the floating-point sine table: 
 tableSize = 512;
 for (n = 0; n < (tableSize + 1); n++)
 {
 sinTable[n] = sin(2*PI*n/tableSize);
 }

Table values are in q32 (1.31 fixed-point format) and generation is done in three steps. First, generate sin values in floating point: 
 tableSize = 512;
 for (n = 0; n < (tableSize + 1); n++)
 {
 sinTable[n] = sin(2*PI*n/tableSize);
 }  where PI value is 3.14159265358979

Table values are in Q15 (1.15 fixed-point format) and generation is done in three steps. First, generate sin values in floating point: 
 tableSize = 512;
 for (n = 0; n < (tableSize + 1); n++)
 {
 sinTable[n] = sin(2*PI*n/tableSize);
 }  where PI value is 3.14159265358979
